import React from 'react';
import "./header.css"




const Header = () => {
  return (
    <header className="background_header">

        <div className="hyi">    
          <ul className="spisok_inline">
              <li id="menu"><p>Каталог</p></li>
              <li id="menu">F.A.Q</li>
              <li id="menu">Контакты</li>
          </ul>     
        </div>
    </header> 
  );
}


export default Header
